snippet.description:
Matéria exibida no dia 02/07/2020
Um remédio pra vermes, que poderia ajudar na prevenção à covid 19 sumiu das farmácias. Isso depois que repercutiu o vídeo de um grupo de médicos que defende tanto o uso dele, como o inicio precoce do tratamento contra a doença, logo no primeiro dia de sintomas. Alguns médicos goianos também não concordam que pessoas com sintomas leves de covid não sejam tratadas. 
